import React, { useState, useEffect } from 'react'
import List from './List'

function App() {
    const [info, setInfo] = useState([])

    useEffect(() => {
        fetch('http://localhost:4000/doubleSpeak')
            .then((r)=>r.json())
            .then((stuff)=>setInfo(stuff))
    }, [])

    return(
        <List info={info}/>
    )
}
export default App
